DROP DATABASE IF EXISTS eBoutique;
CREATE DATABASE IF NOT EXISTS eBoutique;

use eBoutique;
/*Creation DataBase*/
CREATE TABLE categories
(
  id bigint NOT NULL AUTO_INCREMENT,
  ct_name varchar(100) NOT NULL,
  ct_description varchar(200),
  CONSTRAINT pk_categories PRIMARY KEY (id)
);

CREATE TABLE commandes
(
  id bigint NOT NULL AUTO_INCREMENT,
  user_id bigint NOT NULL,
  dateFacturation datetime NOT NULL DEFAULT now(),
  addr_facturation varchar(100),
  addr_livraison varchar(100) NOT NULL,
  methode_paiement varchar(30) NOT NULL,
  status varchar(100) NOT NULL,
  CONSTRAINT pk_commande PRIMARY KEY (id)
);

CREATE TABLE fabricants
(
  id bigint NOT NULL AUTO_INCREMENT,
  fb_name varchar(100) NOT NULL,
  CONSTRAINT pk_fabricant PRIMARY KEY (id)
);

CREATE TABLE methode_paiements
(
  method_paiement_id bigint NOT NULL AUTO_INCREMENT,
  user_id bigint NOT NULL,
  numero_carte bigint NOT NULL,
  nom_carte varchar(30) NOT NULL,
  exp_date date NOT NULL,
  CONSTRAINT PK_Paiement PRIMARY KEY (method_paiement_id)
);

CREATE TABLE produit_commande
(
  produit_id bigint NOT NULL,
  commande_id bigint NOT NULL,
  qty bigint,
  CONSTRAINT pk_produit_commande PRIMARY KEY (produit_id, commande_id)
);

CREATE TABLE produits
(
  id bigint NOT NULL AUTO_INCREMENT,
  pr_name varchar(100) NOT NULL,
  pr_price decimal(8,4) unsigned,
  categorie_id bigint,
  pr_rabais decimal(6,4) unsigned DEFAULT 0,
  fabricant_id bigint,
  CONSTRAINT pk_products PRIMARY KEY (id)
);

CREATE TABLE users
(
  user_id bigint NOT NULL AUTO_INCREMENT,
  user_login varchar(30) NOT NULL,
  user_password varchar(200) NOT NULL,
  user_title varchar(10),
  user_firstname varchar(100) NOT NULL,
  user_lastname varchar(100) NOT NULL,
  user_emailaddr varchar(100),
  CONSTRAINT pk_users PRIMARY KEY (user_id)
);

ALTER TABLE commandes ADD CONSTRAINT fk_commande_user_id
  FOREIGN KEY (user_id) REFERENCES users (user_id);

ALTER TABLE methode_paiements ADD CONSTRAINT fk_methode_paiements_user_id
  FOREIGN KEY (user_id) REFERENCES users (user_id);

ALTER TABLE produit_commande ADD CONSTRAINT fk_produit_commande_c
  FOREIGN KEY (commande_id) REFERENCES commandes (id);

ALTER TABLE produit_commande ADD CONSTRAINT fk_produit_commande_id
  FOREIGN KEY (produit_id) REFERENCES produits (id);

ALTER TABLE produits ADD CONSTRAINT fk_produits_categorie
  FOREIGN KEY (categorie_id) REFERENCES categories (id);

ALTER TABLE produits ADD CONSTRAINT fk_produits_id
  FOREIGN KEY (fabricant_id) REFERENCES fabricants (id);


